import React from 'react';
import {Route} from 'react-router-dom'
import CollectionOverviewContainer from '../../components/collection-overview/collection-overview.container'

// import CollectionPage from'../collection/collection.component'
import CollectionPreviewContainer from '../../components/collection-preview/collection-preview.container'

import {connect} from 'react-redux'
import  {fetchCollectionsStartAsync} from '../../redux/shop/shop.action'




class ShopComponent extends React.Component{

 componentDidMount(){
   const {fetchCollectionsStartAsync}=this.props;
   fetchCollectionsStartAsync()
 }

render(){
  const {match}=this.props
 
   return(
            <div className='shop-page'>
              {/* <Route exact path={`${match.path}`} component={CollectionOverviewContainer} /> */}
              <Route exact path={`${match.path}/:collectionId`} component={CollectionPreviewContainer}/>
      
            </div>
        )}};       
        
       
  const mapDispatchToProps=dispatch=>({
  fetchCollectionsStartAsync:()=>dispatch(fetchCollectionsStartAsync())  
  })      
export default connect(null,mapDispatchToProps)(ShopComponent);
